// components/Layout.js

import Head from "next/head";




const Layout = props => {
    const appTitle = `> WHATABYTE`;

    return (
        <div className="Layout">
            <Head>
                <title>WHATABYTE</title>
                <meta name="viewport" content="width=device-width, initial-scale=1" />
                <meta charSet="utf-8" />
            </Head>


        </div>
    );
};

export default Layout;
